import React, {useEffect,useState} from 'react'
import SearchBar from "./SearchBar"
import DataArtworkCard from "./DataArtworkCard"
// import ArtworkContainer from "./ArtworkContainer"

function Database() {

const [search,setSearch] = useState("")
const [artworks, setArtworks] = useState([])

        useEffect(() => {
            fetch(`https://collectionapi.metmuseum.org/public/collection/v1/search?isHighlight=true&q=Highlight`)
            .then(r=> r.json())
            .then((data) => {
        // console.log(data.objectIDs)
                data.objectIDs.map((id) => {
                    fetch(`https://collectionapi.metmuseum.org/public/collection/v1/objects/${id}`)
                    .then(r=> r.json()) 
                    .then (
                        (id) => {
                       setArtworks(id)
                    })

                })
            })},[search])



const artworkCard = artworks.map((artwork)=> (
      <DataArtworkCard 
        key={artwork.id}
        artwork={artwork}
      />
  ))

return (
<div> 
    <SearchBar searchTerm={search} onSearchChange={setSearch}/>
    <ul className="cards">
      {artworkCard} 
    </ul>
    </div>
  )

}
export default Database
